import '../index.css';

export default function Header() {
  return (
    <header className="App-header">
      <img id="logo" src="https://em-content.zobj.net/source/emojipedia/328/light-blue-heart_.png" alt="wolt company logo" />
      <h2 id="title">Delivery fee calculator</h2>
    </header>
  );
}
